import React from 'react';

/**
 * This will contain the items in the footer of the App
 */
const nav = styled.a.attrs({
    className: 'navbar navbar-dark bg-primary',
})``

function Footer() {
    return(
        <nav>
            <h3> This is a footer. </h3>
        </nav>
    )
}
export default Footer;
